import React from 'react';
import styled from 'styled-components';

const ServicesContainer = styled.div`
  max-width: 1200px;
  margin: 0 auto;
  padding: 4rem 2rem;
`;

const PageTitle = styled.h1`
  text-align: center;
  font-size: 2.5rem;
  margin-bottom: 3rem;
  color: #2c3e50;
`;

const ServicesGrid = styled.div`
  display: grid;
  grid-template-columns: repeat(auto-fit, minmax(350px, 1fr));
  gap: 2rem;
  margin-bottom: 4rem;
`;

const ServiceCard = styled.div`
  background: white;
  border-radius: 15px;
  padding: 2rem;
  box-shadow: 0 10px 30px rgba(0, 0, 0, 0.1);
  transition: all 0.3s ease;
  border: 1px solid #e1e8ed;

  &:hover {
    transform: translateY(-10px);
    box-shadow: 0 20px 40px rgba(0, 0, 0, 0.15);
  }
`;

const ServiceIcon = styled.div`
  font-size: 3rem;
  margin-bottom: 1rem;
  text-align: center;
`;

const ServiceTitle = styled.h3`
  font-size: 1.5rem;
  color: #2c3e50;
  margin-bottom: 1rem;
  text-align: center;
`;

const ServiceDescription = styled.p`
  color: #7f8c8d;
  line-height: 1.6;
  margin-bottom: 1.5rem;
  text-align: center;
`;

const ServiceFeatures = styled.ul`
  list-style: none;
  padding: 0;
  margin: 0;

  li {
    padding: 0.5rem 0;
    color: #555;
    position: relative;
    padding-left: 1.5rem;

    &:before {
      content: "✓";
      color: #27ae60;
      font-weight: bold;
      position: absolute;
      left: 0;
    }
  }
`;

const PricingSection = styled.section`
  margin-top: 4rem;
`;

const SectionTitle = styled.h2`
  text-align: center;
  font-size: 2rem;
  margin-bottom: 3rem;
  color: #3498db;
`;

const PricingGrid = styled.div`
  display: grid;
  grid-template-columns: repeat(auto-fit, minmax(300px, 1fr));
  gap: 2rem;
`;

const PricingCard = styled.div`
  background: white;
  border-radius: 15px;
  padding: 2rem;
  text-align: center;
  box-shadow: 0 10px 30px rgba(0, 0, 0, 0.1);
  border: 2px solid ${props => props.featured ? '#3498db' : '#e1e8ed'};
  position: relative;

  ${props => props.featured && `
    transform: scale(1.05);
    
    &:before {
      content: "인기";
      background: #3498db;
      color: white;
      padding: 0.5rem 1rem;
      border-radius: 20px;
      position: absolute;
      top: -15px;
      left: 50%;
      transform: translateX(-50%);
      font-size: 0.9rem;
      font-weight: bold;
    }
  `}
`;

const PlanName = styled.h3`
  font-size: 1.5rem;
  color: #2c3e50;
  margin-bottom: 1rem;
`;

const PlanPrice = styled.div`
  font-size: 2.5rem;
  font-weight: bold;
  color: #e74c3c;
  margin-bottom: 1rem;

  span {
    font-size: 1rem;
    color: #7f8c8d;
  }
`;

const PlanFeatures = styled.ul`
  list-style: none;
  padding: 0;
  margin: 1.5rem 0;

  li {
    padding: 0.5rem 0;
    color: #555;
  }
`;

const PlanButton = styled.button`
  background: ${props => props.featured ? '#3498db' : '#95a5a6'};
  color: white;
  border: none;
  padding: 1rem 2rem;
  border-radius: 5px;
  cursor: pointer;
  font-size: 1rem;
  transition: all 0.3s ease;

  &:hover {
    background: ${props => props.featured ? '#2980b9' : '#7f8c8d'};
    transform: translateY(-2px);
  }
`;

const ServicesPage = () => {
  return (
    <ServicesContainer>
      <PageTitle>우리의 서비스</PageTitle>

      <ServicesGrid>
        <ServiceCard>
          <ServiceIcon>💻</ServiceIcon>
          <ServiceTitle>웹 개발</ServiceTitle>
          <ServiceDescription>
            현대적이고 반응형 웹사이트를 구축하여 
            사용자 경험을 향상시킵니다.
          </ServiceDescription>
          <ServiceFeatures>
            <li>반응형 디자인</li>
            <li>SEO 최적화</li>
            <li>빠른 로딩 속도</li>
            <li>모바일 친화적</li>
            <li>보안 강화</li>
          </ServiceFeatures>
        </ServiceCard>

        <ServiceCard>
          <ServiceIcon>📱</ServiceIcon>
          <ServiceTitle>모바일 앱 개발</ServiceTitle>
          <ServiceDescription>
            iOS와 Android 플랫폼을 위한 
            네이티브 및 크로스 플랫폼 앱을 개발합니다.
          </ServiceDescription>
          <ServiceFeatures>
            <li>iOS & Android 개발</li>
            <li>React Native</li>
            <li>Flutter</li>
            <li>앱스토어 등록</li>
            <li>지속적인 유지보수</li>
          </ServiceFeatures>
        </ServiceCard>

        <ServiceCard>
          <ServiceIcon>☁️</ServiceIcon>
          <ServiceTitle>클라우드 솔루션</ServiceTitle>
          <ServiceDescription>
            AWS, Azure, Google Cloud를 활용한 
            확장 가능한 클라우드 인프라를 구축합니다.
          </ServiceDescription>
          <ServiceFeatures>
            <li>클라우드 마이그레이션</li>
            <li>서버리스 아키텍처</li>
            <li>자동 스케일링</li>
            <li>데이터베이스 관리</li>
            <li>보안 및 백업</li>
          </ServiceFeatures>
        </ServiceCard>

        <ServiceCard>
          <ServiceIcon>🤖</ServiceIcon>
          <ServiceTitle>AI & 머신러닝</ServiceTitle>
          <ServiceDescription>
            인공지능과 머신러닝 기술을 활용하여 
            비즈니스 프로세스를 자동화합니다.
          </ServiceDescription>
          <ServiceFeatures>
            <li>데이터 분석</li>
            <li>예측 모델링</li>
            <li>자연어 처리</li>
            <li>컴퓨터 비전</li>
            <li>챗봇 개발</li>
          </ServiceFeatures>
        </ServiceCard>

        <ServiceCard>
          <ServiceIcon>🔧</ServiceIcon>
          <ServiceTitle>시스템 통합</ServiceTitle>
          <ServiceDescription>
            기존 시스템과 새로운 기술을 
            원활하게 통합하여 효율성을 높입니다.
          </ServiceDescription>
          <ServiceFeatures>
            <li>API 개발</li>
            <li>레거시 시스템 통합</li>
            <li>데이터 동기화</li>
            <li>워크플로우 자동화</li>
            <li>성능 최적화</li>
          </ServiceFeatures>
        </ServiceCard>

        <ServiceCard>
          <ServiceIcon>📊</ServiceIcon>
          <ServiceTitle>데이터 분석</ServiceTitle>
          <ServiceDescription>
            빅데이터를 분석하여 
            비즈니스 인사이트를 도출합니다.
          </ServiceDescription>
          <ServiceFeatures>
            <li>데이터 수집 및 정제</li>
            <li>시각화 대시보드</li>
            <li>실시간 분석</li>
            <li>예측 분석</li>
            <li>보고서 생성</li>
          </ServiceFeatures>
        </ServiceCard>
      </ServicesGrid>

      <PricingSection>
        <SectionTitle>요금제</SectionTitle>
        <PricingGrid>
          <PricingCard>
            <PlanName>기본</PlanName>
            <PlanPrice>
              ₩500,000<span>/월</span>
            </PlanPrice>
            <PlanFeatures>
              <li>기본 웹사이트 구축</li>
              <li>반응형 디자인</li>
              <li>5개 페이지</li>
              <li>기본 SEO</li>
              <li>이메일 지원</li>
            </PlanFeatures>
            <PlanButton>선택하기</PlanButton>
          </PricingCard>

          <PricingCard featured>
            <PlanName>프로</PlanName>
            <PlanPrice>
              ₩1,200,000<span>/월</span>
            </PlanPrice>
            <PlanFeatures>
              <li>고급 웹사이트 구축</li>
              <li>커스텀 디자인</li>
              <li>무제한 페이지</li>
              <li>고급 SEO</li>
              <li>24/7 지원</li>
              <li>모바일 앱 포함</li>
            </PlanFeatures>
            <PlanButton featured>선택하기</PlanButton>
          </PricingCard>

          <PricingCard>
            <PlanName>엔터프라이즈</PlanName>
            <PlanPrice>
              ₩3,000,000<span>/월</span>
            </PlanPrice>
            <PlanFeatures>
              <li>완전 맞춤형 솔루션</li>
              <li>AI 통합</li>
              <li>클라우드 인프라</li>
              <li>전담 매니저</li>
              <li>우선 지원</li>
              <li>성능 모니터링</li>
            </PlanFeatures>
            <PlanButton>문의하기</PlanButton>
          </PricingCard>
        </PricingGrid>
      </PricingSection>
    </ServicesContainer>
  );
};

export default ServicesPage;
